import React from "react"



function Tiket(props) {

    const getWeekDay = (date) => {
        const year = "20"+date.substr(6,2);
        const month = date.substr(3,2);
        const day = date.substr(0,2);
        const newDate  = new Date (year, month - 1, day)
        const weekDay = [ "вс", "пн", "вт", "ср", "чт", "пт", "сб" ];
        return weekDay[newDate.getDay()];
      }
    
      const getDateFormat = (date) =>{
        const year = "20"+date.substr(6,2);
        const month = date.substr(3,2);
        const day = date.substr(0,2);
        const newDate  = new Date (year, month - 1, day);
        const monthName = ["янв", "фев", "мар", "апр", "мая", "июня", "июля", "авг", "сент", "окт", "ноя", "дек"];
        const newMonth = monthName[newDate.getMonth()];
        return `${day} ${newMonth} ${year}`
      }
      debugger;

    const logot = (carrier) => { 
          if (carrier=='S7') {var logotype = <img src="data:image/png;base64,"></img>} 
          if (carrier=='TK') {var logotype = <img src="data:image/png;base64,"></img>}
          if (carrier=='SU') {var logotype = <img src="data:image/png;base64,"></img>} 
          if (carrier=='BA') {var logotype = <img src="data:image/png;base64,"></img>}
          return logotype
        }

        const changeCurrency = (price) => {
            const usdRate = 64.38; 
            const eurRate = 73.08; 
            if (props.currency === "usd" ) return `$ ${Math.floor(price/usdRate)} `;
            if (props.currency === "eur" ) return `€ ${Math.floor(price/eurRate)} `;
            else return `${price} Руб`
          }

    return (
        <div class="tikets">
        <div>	  
            <div id="logo">{logot(props.carrier)}</div>
            <button id="btn">Купить за {changeCurrency(props.price)}</button>
        </div>
        <div id="originname">
            <div class="time"><span>{props.departureTime}</span></div>
            <div class="city"><span>{props.origin}, {props.originName}</span></div>
            <div class="dataflight"><span>{getDateFormat(props.departureDate)}, {getWeekDay(props.departureDate)}</span></div>
        </div>
        <div id="destinationname">
            <div class="time"><span>{props.arrivalTime}</span></div>
            <div class="city"><span>{props.destination}, {props.destinationName}</span></div>
            <div class="dataflight"><span>{getDateFormat(props.departureDate)}, {getWeekDay(props.departureDate)}</span></div>
        </div>
      </div>
    )
}

export default Tiket